import React from "react";
import {NavLink} from "react-router-dom";

const ErrorPage = () => {
  return (
    <>
      <h1>404 Error Page</h1>
      <h1> Kindly Visit the Genuine links</h1>
      <NavLink to='/'>Back to Home Page</NavLink>
    </>
  );
};

export default ErrorPage;
